As the last few weeks have shown, gun violence is far too prevalent in this country. But we have the power to stop that.

I’m proud to join @RepThomson, @replloyddoggett, and other Democrats in demanding Speaker Mike Johnson and Congressional Republicans pass commonsense gun reform. We need this generation of Republicans to join Democrats in protecting Americans.  

@HouseGVP

We should not be playing partisan games on critical issues like gun violence. 
 
Earlier this week, my colleagues backed my amendment to save funding for gun violence prevention research. I am thankful for their support.

Unfortunately, House Republicans voted against this amendment and ended this research.

