As Putin continues his brutal, illegal invasion, we must continue to support the Ukrainian people in defending their homeland. 

I was proud to meet First Vice Prime Minister of Ukraine @svyrydenko_Y and President Zelensky’s Chief of Staff @andriyyermak recently, along with my fellow Co-Chairs of the @UkraineCaucus. Together, we recognized Ukraine's resilience in fending off Putin's forces and discussed how the U.S. can best support an end to the war.

